import { Text, View, Image, StyleSheet, Pressable } from "react-native";

const Navbar = () => {
  return (
    <View style={styles.navbarMain}>
      <View style={styles.navbarContainer}>
        <Pressable style={styles.navbarIcon} android_ripple={{borderless:true}}>
          <Image source={require("../../assets/images/check-list.png")} />
        </Pressable>
        <Pressable>
          <Image source={require("../../assets/images/home.png")} />
        </Pressable>
        <Pressable>
          <Image source={require("../../assets/images/add.png")} />
        </Pressable>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  navbarMain: {
    position: "absolute",
    alignItems: "center",
    bottom: 20,
  },
  navbarContainer: {
    flexDirection: "row",
    backgroundColor: "#eee",
    width: "90%",
    justifyContent: "space-between",
    borderRadius: 40,
  },
  navbarIcon:{
    padding:10,
    borderColor:'red',
    borderWidth:2
  }
});

export default Navbar;
